import React from "react";
import {useLocation, useHistory} from 'react-router-dom';

function About() {

    let location = useLocation();

    let {nome} = location.state || '';

    return (
        <div>
            <h1>
                About {nome}
            </h1>
        </div>
    )
}

export default About;
